using namespace std;


class LRUCache{
    class V2C{
        public:
        int value;
        int count;
        multimap<int, int>::iterator it;
//        int count;
    };

    int max;
    int count;
    multimap<int, V2C> key2Value2Count;
    multimap<int, int> count2Key;
    public:
        LRUCache(int capacity)
        {
            max = capacity;
        }

        int get(int key){ 
            multimap<int, V2C>::iterator it = key2Value2Count.find(key);
            if(it != key2Value2Count.end())
            {
                V2C& tmp = it->second;
#if 0
                pair <multimap<int,int>::iterator, multimap<int,int>::iterator> ret;
                ret = count2Key.equal_range(tmp.count);
                for(multimap<int,int>::iterator it=ret.first; it!=ret.second;++it)
                {
                    if(it->second == key)
                    {
                        count2Key.erase(it);
                        tmp.count++;
                        count2Key.insert(pair<int, int>(tmp.count, key));
                        break;
                    }
                }
#endif
                count2Key.erase(tmp.it);
                tmp.count++;
                multimap<int,int>::iterator iit = count2Key.insert(pair<int,int>(tmp.count,key));
                tmp.it=iit;
#if 0
                cout << "cache hit" << key << endl;
#endif
                return tmp.value;
            }
            else
            {
        //        cout << "cache miss" << key << endl;
                return -1;
            }
        }

        void set(int key, int value)
        {
            multimap<int, V2C>::iterator it = key2Value2Count.find(key);

            if(it != key2Value2Count.end())
            {
                get(key);
            }
            else
            {
                if(count >= max)
                {
                    multimap<int, int>::iterator it=count2Key.begin();
      //              cout << "cache eviction: " << it->second << endl;
                    key2Value2Count.erase(it->second);
                    count2Key.erase(it);
                    count--;
                }
                
                multimap<int,int>::iterator iit = count2Key.insert(pair<int,int>(1, key));

                V2C tmp;
                tmp.value = value;
                tmp.count = 1;
                tmp.it = iit;
                    
                key2Value2Count.insert(pair<int, V2C>(key, tmp));
                count++;
            }
        }
};


